require 'minitest/autorun'
require '../strings/morgan-and-a-string'

class TestMorganAndAString < Minitest::Test

  def setup
    @subject = MorganString.new
  end
#  O
#  O

#  MOOMOMMOOMOMMOOMOOMOO


  def test_1
    assert_output(stdout = "MOOMOO\n") { @subject.find_minimal_string('MO', 'OOMO') }
    assert_output(stdout = "MOOMOO\n") { @subject.find_minimal_string('OOMO', 'MO') }
  end

  def test_2
    assert_output(stdout = "MOOMOOMOOOO\n") { @subject.find_minimal_string('MOOMOO', 'OOMOO') }
    assert_output(stdout = "MOOMOOMOOOO\n") { @subject.find_minimal_string('OOMOO', 'MOOMOO' ) }
  end

  def test_3
    assert_output(stdout = "MOOMMOOMOOOO\n") { @subject.find_minimal_string('MOOMMOO', 'OOMOO') }
  end

  def test_4
    assert_output(stdout = "MOOMOMOOMOMOO\n") { @subject.find_minimal_string('MOOMOMO', 'OOMOMO') }
  end

  def test_5
    assert_output(stdout = "OMOMMOMO\n") { @subject.find_minimal_string('OMO', 'OMOMM') }
    assert_output(stdout = "OMOMMOMO\n") { @subject.find_minimal_string('OMOMM','OMO') }
  end

  def test_6
    assert_output(stdout = "OOMOMMOOMO\n") { @subject.find_minimal_string('OOMO', 'OOMOMM') }
    assert_output(stdout = "OOMOMMOOMO\n") { @subject.find_minimal_string('OOMOMM', 'OOMO') }
  end

  def test_7
    assert_output(stdout = "MOOMOMMOOMOMMOOMOOMOO\n") { @subject.find_minimal_string('MOOMOMMOOMO', 'OOMOMMOOMO') }
    assert_output(stdout = "MOOMOMMOOMOMMOOMOOMOO\n") { @subject.find_minimal_string('OOMOMMOOMO', 'MOOMOMMOOMO') }
  end

  def case17
    assert_output(stdout =
          '' +
          '
') {
      @subject.find_minimal_string(
          '',
#         '',
           '')
#          '',
    }
  end
end